Descrição

Descrição:
Propósito do Cargo:
Suportar o negócio com relatórios e análises de dados relevantes para gerenciamento e tomada de decisão.

Principais atividades:
Criar rotinas de ETL;
Desenvolver dashboards em Qlik Sense e relatórios Nprinting;
Realizar análises descritivas, preditivas e prescritivas;
Desenvolver/gerenciar soluções de Machine Learning para solucionar problemas de negócios;

Requisitos:
Ensino superior completo (Estatística, Tecnologia da Informação ou correlatos);
Experiência com Qlik Sense ou similares;
Experiência com linguagem SQL;
Experiência com lógica de programação;
Experiência com ETL e Modelagem dimensional;
Será um diferencial conhecimento prático em aprendizado supervisionado, não supervisionado e séries temporais.
